import '../index.css';
import React, { useEffect, useState,  Component }  from 'react';
import { useHistory } from "react-router-dom";



function Home() {
  let history = useHistory();
  let [id, setId] = useState("");



  return (

    <div className="flex shadow3 justify-center">
      <div className="bg-pink-200 shadow3 mt-8 p-3 text-center border-yellow-200 border-8 rounded-lg">



        <div className="flex justify-center m-3">
        <p>
          Passwort: &nbsp;
        </p>
        <input
          className="rounded-xl p-1"
          value={id}
          onChange={e =>  (id.length > 7 && e.target.value.length > id.length) ? undefined :

              setId(e.target.value)

          }
        />
        </div>

            <div
              className=" bg-yellow-200 rounded-xl hover:bg-yellow-700 shadow3"
              onClick={() => (id == "") ? history.push("/quiz/" + id) : undefined}
            >
              Solve It!
            </div>


      </div>
    </div>
  )
}

export default Home;
